import React, {Fragment} from 'react';
import Insta from '../UI/assets/instagram.png';

import styles from './FooterContact.module.css';

function FooterContact () {
    return (
        <Fragment>
            <footer className={`${styles.footer} flex`} style={{justifyContent:'center'}}>
                <h2 style={{textAlign:'center'}}>Contact Info</h2>
                <ul style={{textAlign:'center'}}>
                    <li>
                        Email: <a href="mailto:alora@beebettermassage.com">alora@beebettermassage.com</a>
                    </li>
                    <li>
                        Phone: 385-313-0591
                    </li>
                </ul>
                <p><li className={styles.instagramLink}><a href="https://www.instagram.com/bee.better.massage"><img src={Insta} alt="instagram"/></a></li></p>

            </footer>



        </Fragment>
    )
}
export default FooterContact;
